import * as React from "react";
//import Button from './Button.js';
import { Button } from "@mui/material";
import { ButtonGroup } from "@mui/material";
import { Checkbox } from "@mui/material";

function App() {
  return (<div><ButtonGroup variant="outlined" aria-label="outlined primary button group">
  <Button>One</Button>
  <Button>Two</Button>
  <Button>Three</Button>
</ButtonGroup><Checkbox></Checkbox></div>);
}

export default App;
